		<Stack direction="row" spacing={2}>
			<p>Desenvolvido por Vin√≠cius Dias e Matheus Hoske - Todos os direitos Reservados //</p>
			<img src={logo} alt="logo" className="logo" />
		</Stack>
	</footer>
)
export default Rodape;
